export function CorridorMap({
    viewBoxHeight=600, 
    viewBoxWidth=600,
    selectedScenario='c',
    selectedMode=0,
    selectedDirection=false,
    selectedZone=0,
    onSelection=(zone) => undefined
}) {
    const [flowData, setFlowData] = useState()
    const [flowsLoaded, setFlowsLoaded] = useState(false);
    const [flows, setFlows] = useState();
    const [modalSplit, setModelSplit] = useState();
    const [selectedFlow, setSelectedFlow] = useState();
    const [modeSplit, setModeSplit] = useState();

    useEffect(() => {
        setFlowsLoaded(false);
        fetch('data/demand/flow_matrix.json')
        .then(response => {
            return response.json()
        }).then(data => {
            setFlowData(data);
            setFlowsLoaded(true);
        }).catch((e) => {
            console.log(e.message);
        });
    }, [])

    useEffect(() => {
        if (! flowsLoaded) {
            setFlows([])
            return
        }
        const getFlow = (fromZone, toZone) => {
            const origFlows = flowData.flows[fromZone];
            if (origFlows === undefined) return 0
            const destFlow = origFlows[toZone]
            if (destFlow === undefined) return 0
            const modeFlows = destFlow[selectedScenario]
            if (modeFlows === undefined) return 0
            return modeFlows[selectedMode]
        }

        const origZones = Object.keys(flowData.flows);
        const directedFlows = selectedDirection ? origZones.map((fromZone) => getFlow(fromZone, selectedZone)) : origZones.map((toZone) => getFlow(selectedZone, toZone))
        const totalFlow = directedFlows.reduce((rv, v) => rv + (v ?? 0), 0)
        var maxFlow = 10000 //Math.max(...directedFlows.map((v) => v ?? 0))
        const scaledFlows = maxFlow > 0 ? directedFlows.map((v) => (v ?? 0) / (maxFlow)) : directedFlows.map((v) => 0)
        setFlows(scaledFlows)
        
        const stats = Object.keys(flowData.flows[selectedZone] || []).reduce((rv, toZone) => {
            const flow = flowData.flows[selectedZone][toZone][selectedScenario];
            return rv.map((val, mode) => val + (flow[mode] ?? 0))
        }, [0, 0, 0, 0])
        setModeSplit(stats)

    }, [flowsLoaded, selectedDirection, selectedZone, selectedMode, selectedScenario])

    
    return (
        <svg width="100%"  height="600" viewBox="0 0 204.63524 183.474">
            <marker 
                id="arrowhead" markerWidth="5" markerHeight="3.5" 
                refX="0" refY="1.75" orient="auto"
            >
                <polygon points="0 0, 5 1.75, 0 3.5"/>
            </marker>
             <g id="zones" transform="translate(-120.48976,77.995281)" style={{display: 'inline'}}>
                {zones.map((z) => <CorridorMultiPolygon 
                                    zone={z}
                                    selected={selectedZone === z.id}
                                    onSelection={(zone) => onSelection({...zone, name: flowData.labels.places[zone.id], stats: modeSplit})}
                                    onHover={(zone) => setSelectedFlow({from: selectedZone, to: zone?.id})}
                                    value={flowsLoaded ? flows[z.id] : 0} 
                                />)}
            </g>
            {flowsLoaded && Object.keys(flowData.flows).map((z) => <Arrow from={zones[selectedZone]} to={zones[z]} width={flows[z] * 5} />)}
        </svg>
    )
}


function Arrow({from, to, width=1}) {

    const center_coord = (zone) => {
        return `${zone.center[0]},${zone.center[1]}`
    }

    if (! from?.center) return
    if (! to?.center) return

    return (            
        <path d={`M ${center_coord(from)} ${center_coord(to)}`} 
            style={{fill: 'none', stroke: 'rgba(255, 255, 255, .5)', strokeWidth: width, strokeLinecap: "round"}}/>
    )
}


