function CorridorMultiPolygon({zone, fillLight='#1f77b4', fillLighter='#1f00b4', fillSelected='#439fdf', selected=false, onSelection=(zone) => undefined, onHover=(zone) => undefined, value=0}){
    return (
        <g 
            id={`zone${zone.id}`}
            pointerEvents="visiblePainted"
            style={{
                fill: selected ? `red` : `rgba(${Math.round((value > 1 ? 1 : value) * 256)}, 100, 100, ${zone.luxembourg ? 1.0 : 0.5})`,
                stroke: 'white',
                strokeWidth: 0.2,
                strokeLinecap: 'butt',
                strokeLinejoin: 'round',
                strokeMiterlimit: 4,
                strokeDasharray: 'none',
            }}
            onClick={evt => onSelection(zone)}
            onMouseEnter={evt => onHover(zone)}
            onMouseOut={evt => onHover()}
            transform={zone.transform}
        >
            {zone.polygons.map((poly) => <CorridorPolygon d={poly} />)}
        </g>
    )
}


function CorridorPolygon({d}) {
    return (
        <path d={d} />
    )
}